scriptlet.script:
try {
	var i = parseInt(Iteration);
	var max = parseInt(Max);

	if(i <= max) {
		scriptletResponse="sleep";
		scriptletContext.put("Iteration",i++);
	}
	else {
		scriptletResponse="failure";
		scriptletContext.put("FailureMessage","SFTP Timeout: " + FailureMessage);
	}
}
catch(e) {
	scriptletContext.put("FailureMessage",e.stack);
	scriptletResponse = "failure";
}

try {
	var re1= /\/([^/]+)$/;
	var array = re1.exec(filename);
	if(array !== null) {
		var file = array[1].trim();
		var step0 = "echo >> .ssh/authorized_keys";
		var step1 = "".concat("cat ",file," >> .ssh/authorized_keys");
		var step2 = "".concat("rm -f ",file);
		var expect = "".concat("expectendswith ",prompt);
		var command = "".concat(expect,"\n", "send ", step0, "\n", expect, "\n", "send ", step1, "\n", expect, "\n", "send ", step2, "\n", expect, "\n", "send exit");
		scriptletContext.put("command",command);
		scriptletResult=command;
		scriptletResponse="success";
	}
	else {
		throw new Error("Failure to retrieve file name");
	}
}
catch(error) {
	scriptletResponse="failure";
	scriptletContext.put("FailureMessage",error);
}

